const config = {
  type: 'bar',
  options: {
    scales: {
      y: {
        beginAtZero: true,
      }
    },
    plugins: {
      filler: {
        propagate: true,
      },
      title: {
        display: true,
        text: 'sandeep'
      }
    },
    interaction: {
      intersect: false,
    }
  },
};

function ThesesChart({chartData}){



  return(
    <Bar
    data={chartData}
    options={config}
    />
  );
}

export default ThesesChart
